import React from 'react';
import useSettingsStore from '../../stores/settingsStore';
import StoryTargets from './StoryTargets';
import ProxyManager from './ProxyManager';
import './Settings.scss';

const Settings = () => {
  const { 
    targets, 
    updateTargets,
    proxies,
    addProxy,
    removeProxy,
    testProxy,
    updateProxy
  } = useSettingsStore();

  return (
    <div className="settings">
      <div className="settings__section">
        <h2 className="settings__title">Story Targets</h2>
        <StoryTargets 
          targets={targets}
          onUpdate={updateTargets}
        />
      </div>
      <div className="settings__section">
        <h2 className="settings__title">Proxy Management</h2>
        <ProxyManager 
          proxies={proxies || []}
          onAdd={addProxy}
          onRemove={removeProxy}
          onUpdate={updateProxy}
          onTest={testProxy}
        />
      </div>
    </div>
  );
};

export default Settings;
